//         color: #6accbc;
//     }
// `

const Projects = () => {

  return (
    <ul>
        {
        projects.map((project) => (
        <Styledli> 
            <IndividualProject name={project}/>
        </Styledli>
        ))
        }
    </ul>
  );
};

export default Projects;
